import './HomePage.css';

const HomePage = () => {
  return (
    <div className='HomeScreen'>
      <div className='HomeLeftScreen'>
        <p></p>
      </div>
      <div className='HomeProfilImage'>
      <img className='ProfilImage' src={require('./img/profil.jpeg')} alt="Resim açıklaması" />
      </div>
      <div>
        <h1 className='YellowTitle'>I'M STEVE MILNER.</h1>
        <h1 className='YellowTitle'>WEB DESIGNER</h1>
      </div>
    </div>
  )
}
export default HomePage;
